Correct. To find the median of the list of data, first order the data from least to greatest: 250,600;
275,800; 275,800; 281,900; 284,700; 295,000; 302,100; 305,400. Since there are 8 values, an even
number, the median is the average of the 2 values in the middle of the ordered list. The median selling price of the houses is $283,300
